import React from "react";
import Model from "../models/Model.js";
export default class List extends React.Component {
    constructor(props) {
        super(props);
        console.log(props);
    }
    render() {
        return (
            <div className="List">
               {this.props.list.map(item => {
                    return(
                        <div className="col-lg-4" key={item._id}>
                            {item.state}
                        </div>
                    )
                })}
            </div>
        )
    }
}
